function Ripple({ circleContainerWidth }: { circleContainerWidth: number }) {
  const width = circleContainerWidth / 2
  return (
    <motion.svg
      xmlns="http://www.w3.org/2000/svg"
      fill="none"
      viewBox="0 0 1347 1347"
      className="absolute inset-0 w-full h-screen lg:h-full"
    >
      <motion.circle
        cx="673.5"
        cy="673.5"
        strokeOpacity={0.12}
        initial={{
          stroke: '#fff',
        }}
        animate={{
          strokeWidth: [64, 256, width * 2, 0],
          r: [0, width, width, 0],
          // stroke: '#0BADEB',
        }}
        transition={{
          ease: 'easeInOut',
          duration: 6,
          repeat: Infinity,
        }}
      />
    </motion.svg>
  )
}
